DROP TABLE IF EXISTS `Abfragen`;
CREATE TABLE `Abfragen` (
  `AB_Index` smallint(6) NOT NULL default '0',
  `AB_Bezeichnung` varchar(30) NOT NULL default '',
  `AB_Statement` varchar(254) NOT NULL default '',
  PRIMARY KEY  (`AB_Index`)
);


LOCK TABLES `Abfragen` WRITE;
INSERT INTO `Abfragen` VALUES (0,'Konfiguration','select * from Konfiguration'),(1,'SubMenü-Schalter','select HM_E0VW, HM_E1HMenue, HM_NrStr, HT_Text, HM_Kommentar from HMenue, HMTexte where HM_E0VW = HT_E0VW and HM_E1HMenue = HT_E1HMenue and HT_Sprache = 0');
UNLOCK TABLES;


